import React from 'react'
import {IProduct} from '../model'

interface ProductProps{
    product: IProduct
}


const Product = ({product}: ProductProps) => {
  return (
    <div>
        {product.id}
        {product.title}
        {product.price}
        {product.description}
        {product.category}
    </div>
  )
}

export default Product
